import React from 'react'
import axios from 'axios'

class Account extends React.Component{
    constructor(){
        super()
        this.state = {
            user:{}
        }
    }
    componentDidMount(){
        axios.get('http://localhost:3006/users/account')
        .then(response => {
            console.log(response.data)
        })
    }
    render(){
        return(
            <div>
                <h2>User Profile</h2>
            </div>
        )
    }
}
export default Account
